import { Route, Routes, Outlet } from "react-router-dom";
import Home from "./components/routes/home/home";

const Navigation = () => {
  return (
    <div>
      <div>
        <h1>
          I am the navigation bar
        </h1>
      </div>
      <Outlet />
    </div>
  )
}
const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigation />}>
        <Route index element={<Home />} />
      </Route>
    </Routes>
  );
}

export default App;
